if(typeof jQuery==="undefined"){throw new Error("AdminLTE requires jQuery")}function initMenu(){var a=$("ul.sidebar-menu a").filter(function(){var b=window.location.href.split("#",1)[0];return this.href==b}).parent();$(a).addClass("active");$(a).parents(".treeview").addClass("active");$(a).parents(".treeview-menu").addClass("menu-open")}$(function(){initMenu()});